webpackJsonp([206],{"./node_modules/json-loader/index.js!./.cache/json/articles-python-python-alliterable.json":function(e,t){e.exports={data:{markdownRemark:{html:'<p><code>all()</code> is a built-in function in Python 3, to check if all items of an <a href="https://docs.python.org/3/glossary.html#term-iterable"><em>iterable</em></a> is <code>True</code>. It takes one argument, <code>iterable</code>.</p>\n<h2>Argument</h2>\n<h3>iterable</h3>\n<p>The <code>iterable</code> argument is the collection whose all entries are to be checked. It can typically be a <code>list</code>, <code>str</code>, <code>dict</code>, <code>tuple</code> etc.</p>\n<h2>Return Value</h2>\n<p>The return value would be a boolean. If and only if <strong>all</strong> entries of iterable are <code>True</code>, it returns <code>True</code>. This function essentially performs a Boolean <code>AND</code> operation over all elements.</p>\n<p>If even one of them is not <code>True</code>, it would return <code>False</code>.</p>\n<p>The <code>all()</code> operation is equivalent to (not internally implemented exactly like this)</p>\n<pre><code>def all(iterable):\n    for element in iterable:\n        if not element:\n            return False\n    return True\n</code></pre>\n<h2>Code Sample</h2>\n<pre><code>print(all([6, 7])) #=> True\nprint(all([6, 7, None])) #=> False  Because this has None\nprint(all([0, 6, 7])) #=> False Because this has zero\nprint(all([9, 8, [1, 2]])) #=> True\nprint(all([9, 8, []])) #=> False Because it has []\nprint(all([9, 8, [1, 2, []]])) #=> True\nprint(all([9, 8, {}])) #=> False Because it has {}\nprint(all([9, 8, {\'engine\': \'Gcloud\'}])) #=> True\n</code></pre>\n<p><img src="//forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=2" alt=":rocket:" title=":rocket:"> <a href="https://repl.it/CL9U/0">Run Code</a></p>\n<p><a href="https://docs.python.org/3/library/functions.html#all">Official Docs</a></p>',frontmatter:{title:"Python Alliterable",parent:"/home/stuart/guides/src/pages/articles/python/python-alliterable/index.md absPath of file"}}},pathContext:{slug:"/articles/python/python-alliterable/"}}}});
